oxy_webhelp_navlinks = {"azr_exocompute_network_setup-d22872e16132":{"topics":[{"title":"Azure standard load balancer settings","shortdesc":"<p class=\"shortdesc\">Exocompute on Azure uses a standard load balancer with a public IP address to manage         network traffic for Azure Kubernetes Service clusters. However, Azure policies that prevent         the creation of public IPs can cause these deployments to fail. To prevent this, you can         provide policy exemptions or configure User Defined Routing.<\/p>","href":"saas\/azr_stnd_load_balancer_settings.html","attributes":{"data-id":"azr_stnd_load_balancer_settings"},"menu":{"hasChildren":false},"tocID":"azr_stnd_load_balancer_settings-d22872e16146","next":"azr_stnd_load_balancer_settings-d22872e16146"},{"title":"IP address planning for Exocompute on Azure","shortdesc":"<p class=\"shortdesc\">For the Exocompute on Azure feature that uses Azure Kubernetes Service clusters as         the underlying compute resources, depending on your workloads, you need to plan the number         of IP addresses required for your cluster nodes and use a subnet size         accordingly.<\/p>","href":"saas\/azr_ip_planning_aks_cluster.html","attributes":{"data-id":"azr_ip_planning_aks_cluster"},"menu":{"hasChildren":false},"tocID":"azr_ip_planning_aks_cluster-d22872e16212","topics":[]},{"title":"Outbound rules for Azure network security group","shortdesc":"<p class=\"shortdesc\">Information about the minimal set of outbound rules for Azure virtual machines and         Azure SQL workloads that require configuration on the network security group associated with         the subnet used for the Exocompute on Azure feature.<\/p>","href":"saas\/azr_outbound_rules_nsg.html","attributes":{"data-id":"azr_outbound_rules_nsg"},"menu":{"hasChildren":false},"tocID":"azr_outbound_rules_nsg-d22872e16223","topics":[]},{"title":"Outbound rules for network security group of Azure Blob Storage","shortdesc":"<p class=\"shortdesc\">Information about the minimal set of outbound rules required to configure on the         network security group associated with the subnet used for the Azure Kubernetes Service         cluster associated with the Azure Blob Storage.<\/p>","href":"azure_blob\/azr_blob_outbound_rules_nsg.html","attributes":{"data-id":"azr_blob_outbound_rules_nsg"},"menu":{"hasChildren":false},"tocID":"azr_blob_outbound_rules_nsg-d22872e16234","next":"azr_blob_outbound_rules_nsg-d22872e16234"},{"title":"Network configuration for Azure CNI overlay","shortdesc":"<p class=\"shortdesc\">Information on configuring network settings, required ports, network rules, and         dynamic ports for Azure CNI overlay to ensure proper functionality of Exocompute on         Azure.<\/p>","href":"saas\/azr_nw_config_cni_overlay.html","attributes":{"data-id":"azr_nw_config_cni_overlay"},"menu":{"hasChildren":false},"tocID":"azr_nw_config_cni_overlay-d22872e16267","topics":[]},{"title":"Firewall configuration for Exocompute on Azure","shortdesc":"<p class=\"shortdesc\">Information about the endpoints you can add to the firewall allowlist to enable         Exocompute on Azure to perform archiving and indexing operations.<\/p>","href":"saas\/azr_excom_firewall_config.html","attributes":{"data-id":"azr_excom_firewall_config"},"menu":{"hasChildren":false},"tocID":"azr_excom_firewall_config-d22872e16278","next":"azr_excom_firewall_config-d22872e16278"},{"title":"Exocompute on Azure vCPU quota requirements","shortdesc":"<p class=\"shortdesc\">Azure vCPU quotas limit virtual CPU allocations for a subscription to manage         resources and prevent monopolization. Adequate quotas for Exocompute ensure uninterrupted         operations.<\/p>","href":"saas\/azr_exocompute_quota_reqs.html","attributes":{"data-id":"azr_exocompute_quota_reqs"},"menu":{"hasChildren":false},"tocID":"azr_exocompute_quota_reqs-d22872e16311","topics":[]},{"title":"Prerequisites for immutable Azure Blob Storage backups","shortdesc":"<p class=\"shortdesc\">Information about specific prerequisites that you must meet to create and manage         immutable backups of Azure Blob Storage in <span class=\"ph\">RSC<\/span>. These prerequisites are         based on the network access configuration of your Azure Blob Storage account.<\/p>","href":"azure_blob\/prereq_immutable_azr_blob_backup.html","attributes":{"data-id":"prereq_immutable_azr_blob_backup"},"menu":{"hasChildren":false},"tocID":"prereq_immutable_azr_blob_backup-d22872e16322","next":"prereq_immutable_azr_blob_backup-d22872e16322"}]}};